eval("// Module\nvar code = \"<template>\\r\\n    <compose view=\\\"../../resources/elements/header.html\\\"></compose>\\r\\n\\r\\n    <div class=\\\"section\\\" id=\\\"firstSection\\\">\\r\\n        <div class=\\\"container\\\">\\r\\n            <div show.bind=\\\"showForm\\\">\\r\\n                <compose view=\\\"./forms/erpsimCompForm.html\\\"></compose>\\r\\n            </div>\\r\\n\\r\\n            <h2>ERPsim Competition NA 2021</h2>\\r\\n            <p>The SAPNAAC board is happy to organize the first North American ERPsim Competition. All university members of the North America SAP University Alliances can register one team. Participation is free. The qualification events are planned for May 25th and May 27th between 6 pm to 9 pm ET and the final is planned for June 2nd from 6 pm to 9 pm ET. The best 3 teams in the North American competition will be invited to participate in the International ERPsim competition on June 10, 2021 at 9 pm ET. Registration for the 2021 North American ERPsim Competition is open. Register your team using the link below.</p>\\r\\n            <h4 class=\\\"linkColor\\\" href=\\\"#\\\">Registration Closed</h4>\\r\\n            <!-- click.trigger=\\\"showRegistrationForm()\\\"  -->\\r\\n            <p>Deadline for Registration: Friday, May 14th, 2021 at 12 pm ET</p>\\r\\n            <p>Qualification Round: May 25 & 27, 6 pm to 9 pm ET</p>\\r\\n            <p>Final Round: June 2, 6 pm to 9 pm ET</p>\\r\\n            <h4>General Rules</h4>\\r\\n            <ul>\\r\\n                <li>The competition is open to all university members of the SAP University Alliances </li>\\r\\n                <li>One team per university can register</li>\\r\\n                <li>Participation is free and registration must be performed by the faculty member who will coach the\\r\\n                    team</li>\\r\\n                <li>Depending on the number of teams registered, there will be between 2 to 3 qualification events and\\r\\n                    one final event</li>\\r\\n                <li>The qualification events are planned for May 25th and May 27th between 6 pm to 9 pm ET. The North\\r\\n                    American ERPsim Final is planned for June 2nd from 6 pm to 9 pm ET</li>\\r\\n                <li>The team size must be minimum of 3 and maximum of 5 students</li>\\r\\n                <li>The teams will play 4 rounds of the ERPsim Manufactring Extended game</li>\\r\\n                <li>One professor per university will be responsible for registering the team and act as the main point\\r\\n                    of contact for the team. Registration must include the university email of all participants</li>\\r\\n                <li>Prior to the competition, questions from the team can be sent by the main point of contact to\\r\\n                    erpsim@hec.ca with the Subject: \\\"North America ERPsim Competition 2021\\\"</li>\\r\\n                <li>We encourage diversity and inclusion, so try to arrange your team as diverse and inclusive as\\r\\n                    possible</li>\\r\\n                <li>No cheating is allowed! All teams must always behave ethically. The organizers reserve the rights to\\r\\n                    disqualify teams who are not playing ethically and fairly</li>\\r\\n                <li>Registration closes on: Friday, May 14, 2021 at 12 pm ET</li>\\r\\n            </ul>\\r\\n            <h4>Virtual Set Up</h4>\\r\\n            <ul>\\r\\n                <li>The first five teams of each semi-final will be invited to participate in the final</li>\\r\\n                <li>Students will be using a real SAP S/4HANA system</li>\\r\\n                <li>Each participant will need a computer with a good Internet connection</li>\\r\\n            </ul>\\r\\n            <h4>Awards</h4>\\r\\n            <ul>\\r\\n                <li>The event will be held via Zoom for a plenary session in-between rounds and virtual breakout rooms\\r\\n                    per team during the rounds</li>\\r\\n                <li>The first three teams in the North American ERPsim final will be invited in the International ERPsim\\r\\n                    Competition on June 10th, 9:00 am to 12:00 pm ET</li>\\r\\n                <li>The winners of the 2021 North American ERPsim final will be declared the 2021 North American ERPsim\\r\\n                    Champions</li>\\r\\n            </ul>\\r\\n            <h4>About the Game</h4>\\r\\n            <p>ERPsim Business Simulation Game: Manufacturing Extended</p>\\r\\n            <p>The ERPsim Manufacturing Game is a live ERP simulation game with a SAP S/4HANA and consists of producing\\r\\n                and selling Muesli breakfast cereals to the German market</p>\\r\\n            <p>During the game, the teams have to run a business in a make-to-stock manufacturing supply chain context\\r\\n                and must interact with suppliers and customers by sending and receiving orders, delivering their\\r\\n                products, and completing the whole end-to-end business cycle. </p>\\r\\n            <p>ERPsim automates the sales process such that each firm receives many orders every round of the\\r\\n                simulation. Several administrative functions in SAP are automated too, so that teams can focus on making\\r\\n                business decisions, rather than mastery of the many transactions of a complex ERP system. Using a mix of\\r\\n                the ERP system’s standard transactions and customized reports, students must analyze information and\\r\\n                make business decisions to ensure the profitability of their operations.</p>\\r\\n            <p>Company valuation is determined by profit and credit rating.</p>\\r\\n            <p>The company with the highest company value at the end of the simulation wins the game!</p>\\r\\n\\r\\n        </div>\\r\\n    </div>\\r\\n    <compose view=\\\"../../resources/elements/footer.html\\\"></compose>\\r\\n</template>\";\n// Exports\nmodule.exports = code;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///modules/site/naerpsim.html\n");

